var Ac4yIdentificationBaseAlgebra=require("@ac4y/ac4y-object/algebra/Ac4yIdentificationBaseAlgebra.js"); 
var Ac4yGUIDHandler = require("@ac4y/ac4y-utility/domain/Ac4yGUIDHandler.js");
var Ac4yDateTimeHandler=require("@ac4y/ac4y-utility/domain/Ac4yDateTimeHandler.js");  

class Ac4yIdentificationBase extends Ac4yIdentificationBaseAlgebra {
    
    constructor(object) {

        super(object);
        if (object!=undefined && object===0) return;
        
        if (!this.hasGUID()) 
            this.setGUID(new Ac4yGUIDHandler().getGUID());
        
        if (!this.hasCreatedAt()) 
            this.setCreatedAt(new Ac4yDateTimeHandler().getSystemTime());
        
    } // constructor

} // Ac4yIdentificationBase

module.exports=Ac4yIdentificationBase
